import styled from 'styled-components'

const ContainerDash = styled.div`
  height: 100vh;
  width: 100vw;
`

const Body = styled.div`
  width: 100%;  
  //background: blue; // cor para teste
  position: relative;
  margin-left: auto;
  margin-right: auto;  
`



export {
  ContainerDash,
  Body
}
